import React from 'react';

function AddNewListButton() {
  const handleClick = () => {
    window.location.href = '/lists/new';
  };

  return (
    <div class="add-new-list-button-container">

      <button onClick={handleClick}>Add New List</button>
      </div>  
  );
}

export default AddNewListButton;
